<p><b>Go Man Go</b> (1953–1983) was an American <a href="/wiki/American_Quarter_Horse" title="American Quarter Horse">Quarter Horse</a> <a href="/wiki/Stallion" title="Stallion">stallion</a> and <a href="/wiki/Horse_racing" title="Horse racing">race horse</a>. He was named World Champion Quarter Running Horse three times in a row, one of only two horses to achieve that distinction. Go Man Go was considered to be of difficult temperament. While waiting in the <a href="/wiki/Starting_gate" title="Starting gate">starting gate</a> for his very first race, he threw his jockey, broke down the gate, and ran alone around the track; he was eventually caught and went on to win the race. During his five years of competition before he was retired from racing in 1960, he had 27 wins and brought earnings of more than $86,000 ($634,000 in 2007 dollars).</p>

<p>Neither of his parents raced. His sire (father), the <a href="/wiki/Thoroughbred" title="Thoroughbred">Thoroughbred</a> stallion <a href="/wiki/Top_Deck_(horse)" title="Top Deck (horse)">Top Deck</a>, was bred by the <a href="/wiki/King_Ranch" title="King Ranch">King Ranch</a>. His <a href="/wiki/Mare" title="Mare">dam</a> (mother) hailed from Louisiana; Go Man Go is thought to have gained his swiftness on the track from her. For the first years of Go Man Go's racing career, his owner faced difficulty in registering him with the <a href="/wiki/American_Quarter_Horse_Association" title="American Quarter Horse Association">American Quarter Horse Association</a> (AQHA), a matter that remained unresolved until 1958.</p>
<p>Go Man Go went on to sire two <a href="/wiki/All_American_Futurity" title="All American Futurity">All American Futurity</a> winners and seven Champion Quarter Running Horses. He was inducted into the <a href="/wiki/American_Quarter_Horse_Hall_of_Fame" title="American Quarter Horse Hall of Fame">American Quarter Horse Hall of Fame</a>, as were two of his offspring. His daughters also produced, or were the mothers of, a number of race winners, including the Hall of Fame member <a href="/wiki/Kaweah_Bar" title="Kaweah Bar">Kaweah Bar</a>. The director of racing for the AQHA once compared his impact on Quarter Horse racing and breeding to that of <a href="/wiki/Man_o%27_War" title="Man o' War">Man o' War</a> in <a href="/wiki/Thoroughbred_horse_race" title="Thoroughbred horse race">Thoroughbred racing</a>, or that of human athletes such as <a href="/wiki/Ben_Hogan" title="Ben Hogan">Ben Hogan</a> and <a href="/wiki/Babe_Ruth" title="Babe Ruth">Babe Ruth</a>.</p>

