<p><a name="Background_and_early_life" id="Background_and_early_life"></a></p>
<h2><span class="editsection">[<a href="/w/index.php?title=Go_Man_Go&amp;action=edit&amp;section=1" title="Edit section: Background and early life">edit</a>]</span> <span class="mw-headline">Background and early life</span></h2>

<p>Go Man Go was <a href="/wiki/Foal" title="Foal">foaled</a> in <a href="/wiki/Wharton,_Texas" title="Wharton, Texas">Wharton, Texas</a> in 1953, as a result of the second breeding between the Thoroughbred stallion <a href="/wiki/Top_Deck_(horse)" title="Top Deck (horse)">Top Deck</a> and the <a href="/wiki/American_Quarter_Horse_Association#Registration" title="American Quarter Horse Association">Appendix Quarter Horse</a> <a href="/wiki/Mare_(horse)" title="Mare (horse)" class="mw-redirect">mare</a> Lightfoot Sis.<sup id="cite_ref-Legends_7-0" class="reference"><a href="#cite_note-Legends-7" title=""><span>[</span>8<span>]</span></a></sup> Top Deck was bred by the <a href="/wiki/King_Ranch" title="King Ranch">King Ranch</a>, and was unraced.<sup id="cite_ref-Wiggins79_8-0" class="reference"><a href="#cite_note-Wiggins79-8" title=""><span>[</span>9<span>]</span></a></sup> J. B. Ferguson had purchased Lightfoot Sis when her then-owner, Octave Fontenot of Prairie Ronde, Louisiana, decided to get out of the horse breeding business.<sup id="cite_ref-Cajun55_9-0" class="reference"><a href="#cite_note-Cajun55-9" title=""><span>[</span>10<span>]</span></a></sup> Ferguson paid $350 for her ($2,733 in 2007 dollars)<sup id="cite_ref-10" class="reference"><a href="#cite_note-10" title=""><span>[</span>11<span>]</span></a></sup> and bred her in 1952 to Top Deck (TB), resulting in Go Man Go's birth the next year.<sup id="cite_ref-Cajun55_9-1" class="reference"><a href="#cite_note-Cajun55-9" title=""><span>[</span>10<span>]</span></a></sup><sup id="cite_ref-12" class="reference"><a href="#cite_note-12" title=""><span>[</span>nb 1<span>]</span></a></sup><sup id="cite_ref-13" class="reference"><a href="#cite_note-13" title=""><span>[</span>nb 2<span>]</span></a></sup> Ferguson also purchased Top Deck, after the stallion injured himself as a yearling.<sup id="cite_ref-Legends117_14-0" class="reference"><a href="#cite_note-Legends117-14" title=""><span>[</span>13<span>]</span></a></sup></p>

<p>Lightfoot Sis showed classic short speed in her pedigree,<sup id="cite_ref-Legends_7-1" class="reference"><a href="#cite_note-Legends-7" title=""><span>[</span>8<span>]</span></a></sup> although she was unraced due to an injury as a <a href="/wiki/Filly" title="Filly">filly</a> that left her blind in one eye.<sup id="cite_ref-Cajun55_9-2" class="reference"><a href="#cite_note-Cajun55-9" title=""><span>[</span>10<span>]</span></a></sup> Her sire was the Thoroughbred stallion Very Wise, and her dam was a Quarter Horse mare named Clear Track.<sup id="cite_ref-Legends_7-2" class="reference"><a href="#cite_note-Legends-7" title=""><span>[</span>8<span>]</span></a></sup><sup id="cite_ref-16" class="reference"><a href="#cite_note-16" title=""><span>[</span>nb 3<span>]</span></a></sup></p>

<p>Scott Wells, a racing correspondent, wrote in <i>The Speedhorse Magazine</i> that Go Man Go "grew up lean and hard-boned, long-bodied and long-hipped, but not the best looking horse in the world. Not the best looking, just the best."<sup id="cite_ref-QWiggins79_17-0" class="reference"><a href="#cite_note-QWiggins79-17" title=""><span>[</span>15<span>]</span></a></sup> Go Man Go had a reputation for being difficult to handle.<sup id="cite_ref-Chamberlain_0-1" class="reference"><a href="#cite_note-Chamberlain-0" title=""><span>[</span>1<span>]</span></a></sup> His trainer once told Walt Wiggins, Sr. that Go Man Go was "jes plain mean as a bear most of the time".<sup id="cite_ref-QChamberlain_18-0" class="reference"><a href="#cite_note-QChamberlain-18" title=""><span>[</span>16<span>]</span></a></sup> Throughout his racing career, Go Man Go stayed mean. One of his jockeys, Robert Strauss, recalled later that Go Man Go "was ornery from the day I met him, but he was the greatest horse I ever rode".<sup id="cite_ref-QLegends122_19-0" class="reference"><a href="#cite_note-QLegends122-19" title=""><span>[</span>17<span>]</span></a></sup></p>

<p><a name="Racing_career" id="Racing_career"></a></p>
<h2><span class="editsection">[<a href="/w/index.php?title=Go_Man_Go&amp;action=edit&amp;section=2" title="Edit section: Racing career">edit</a>]</span> <span class="mw-headline">Racing career</span></h2>
<p>In his five-year racing career, Go Man Go competed in 47&#160;races.<sup id="cite_ref-Digest_2-3" class="reference"><a href="#cite_note-Digest-2" title=""><span>[</span>3<span>]</span></a></sup> He appeared to take naturally to racing; during his training he ran off with his rider—his eventual jockey Robert Strauss—before he was supposed to run.<sup id="cite_ref-Chamberlain_0-2" class="reference"><a href="#cite_note-Chamberlain-0" title=""><span>[</span>1<span>]</span></a></sup> As Strauss said, "When we were breaking him, he ran off with me before we ever wanted him to run. I mean, just flat ran off with me."<sup id="cite_ref-QChamberlain_18-1" class="reference"><a href="#cite_note-QChamberlain-18" title=""><span>[</span>16<span>]</span></a></sup> Robert's brother Eldridge, who was the trainer, once worked the colt minus half a shoe and Go Man Go still managed a time of 18.9&#160;seconds for a 350&#160;yards (320&#160;m) distance.<sup id="cite_ref-Chamberlain_0-3" class="reference"><a href="#cite_note-Chamberlain-0" title=""><span>[</span>1<span>]</span></a></sup></p>

<p>In the moments before his very first race began, Go Man Go flipped over in the starting gate, unseated his rider, crashed through the front and ran around the whole <a href="/wiki/Race_track" title="Race track">track</a>. He finally allowed himself to be caught and reloaded into the starting gate and went on to win that race. He won his next five races with a total lead of nine&#160;<a href="/wiki/Length_(horse_racing)" title="Length (horse racing)">horse-lengths</a>.<sup id="cite_ref-Chamberlain_0-4" class="reference"><a href="#cite_note-Chamberlain-0" title=""><span>[</span>1<span>]</span></a></sup> He faced Vandy's Flash, himself a World Champion Quarter Racing Horse, twelve times.<sup id="cite_ref-Wiggins83_20-0" class="reference"><a href="#cite_note-Wiggins83-20" title=""><span>[</span>18<span>]</span></a></sup><sup id="cite_ref-NyeGreat155_21-0" class="reference"><a href="#cite_note-NyeGreat155-21" title=""><span>[</span>19<span>]</span></a></sup> Their last meeting, on September 6, 1959 at <a href="/wiki/Ruidoso_Downs_(track)" title="Ruidoso Downs (track)">Ruidoso Downs</a>, was also Go Man Go's final race, and was the only one of their races won by Vandy's Flash.<sup id="cite_ref-Wiggins83_20-1" class="reference"><a href="#cite_note-Wiggins83-20" title=""><span>[</span>18<span>]</span></a></sup></p>

<p>He won 27&#160;times, placed second 9&#160;times and was third 3&#160;times.<sup id="cite_ref-Digest_2-4" class="reference"><a href="#cite_note-Digest-2" title=""><span>[</span>3<span>]</span></a></sup> Because he placed so regularly, by the end of his racing career tracks had difficulty filling races if other racing stables knew he was entered.<sup id="cite_ref-Legends_7-3" class="reference"><a href="#cite_note-Legends-7" title=""><span>[</span>8<span>]</span></a></sup> His race earnings were $86,151 with 88&#160;AQHA racing points, which earned him a Superior Race Horse award as well as a Race Register of Merit from the AQHA. The best <a href="/wiki/Speed_index" title="Speed index">speed rating</a>, or racing grade, he achieved was AAAT, the highest grade awarded at the time.<sup id="cite_ref-Digest_2-5" class="reference"><a href="#cite_note-Digest-2" title=""><span>[</span>3<span>]</span></a></sup> Go Man Go was named World Champion Quarter Running Horse for three years running, from 1955 to 1957.<sup id="cite_ref-Pitzer_5-1" class="reference"><a href="#cite_note-Pitzer-5" title=""><span>[</span>6<span>]</span></a></sup> He was the first two-year-old to win the title.<sup id="cite_ref-Chamberlain_0-5" class="reference"><a href="#cite_note-Chamberlain-0" title=""><span>[</span>1<span>]</span></a></sup> He was a multiple <a href="/wiki/Graded_stakes_race" title="Graded stakes race">stakes</a> winner,<sup id="cite_ref-Wiggins80_22-0" class="reference"><a href="#cite_note-Wiggins80-22" title=""><span>[</span>20<span>]</span></a></sup> and his wins included the Pacific Coast Quarter Racing Association Futurity, LA Autumn Championship,<sup id="cite_ref-Moments130_4-1" class="reference"><a href="#cite_note-Moments130-4" title=""><span>[</span>5<span>]</span></a></sup> and the Clabbertown G Stakes, which he won three times in a row. At his retirement, he held the world records at 440&#160;yd (400&#160;m) and 350&#160;yd (320&#160;m), as well as age and sex records at 400&#160;yd (370&#160;m).<sup id="cite_ref-Wiggins80_22-1" class="reference"><a href="#cite_note-Wiggins80-22" title=""><span>[</span>20<span>]</span></a></sup> Go Man Go is still the only stallion who has been World Champion Quarter Running Horse three times, and, along with the <a href="/wiki/Mare_(horse)" title="Mare (horse)" class="mw-redirect">mare</a> Woven Web (TB), is one of only two horses to be three-time winners of the award.<sup id="cite_ref-Champions_23-0" class="reference"><a href="#cite_note-Champions-23" title=""><span>[</span>21<span>]</span></a></sup></p>

<p><a name="Ownership_and_registration_problems" id="Ownership_and_registration_problems"></a></p>
<h2><span class="editsection">[<a href="/w/index.php?title=Go_Man_Go&amp;action=edit&amp;section=3" title="Edit section: Ownership and registration problems">edit</a>]</span> <span class="mw-headline">Ownership and registration problems</span></h2>
<p>In 1955, when Go Man Go was a two-year-old, A.B. Green bragged that he intended to buy the horse from Ferguson. Although Ferguson did not want to sell, he felt he had to at least set a price. After hearing rumors that Green was prepared with a <a href="/wiki/Cashier%27s_check" title="Cashier's check">cashier's check</a> for $40,000, Ferguson set the price at $42,000 cash ($325,181 in 2007 dollars)<sup id="cite_ref-Groves_24-0" class="reference"><a href="#cite_note-Groves-24" title=""><span>[</span>22<span>]</span></a></sup><sup id="cite_ref-25" class="reference"><a href="#cite_note-25" title=""><span>[</span>23<span>]</span></a></sup> and twenty-one&#160;breedings to the stallion. To Ferguson's surprise, Green had that much cash available; Ferguson felt compelled to sell Go Man Go. Two years later, at a <a href="/wiki/Los_Alamitos_Race_Course" title="Los Alamitos Race Course">Los Alamitos</a> race meet, Green claimed that his newest horse, Double Bid, could outrace Go Man Go. This incensed Ferguson, who had just entered Go Man Go's full brother Mr Mackay in a race with Double Bid. Ferguson bet Green $42,000 against Go Man Go that Mr Mackay would beat Double Bid in the upcoming race. Mr Mackay won the race, and Ferguson regained ownership of Go Man Go. Later in 1960, because he also owned Go Man Go's full brother, father, and mother, he sold Go Man Go to Frank Vessels Sr. and Bill and Harriet Peckham for $125,000. Later, however, all three horses retained by Ferguson died prematurely.<sup id="cite_ref-Groves_24-1" class="reference"><a href="#cite_note-Groves-24" title=""><span>[</span>22<span>]</span></a></sup><sup id="cite_ref-27" class="reference"><a href="#cite_note-27" title=""><span>[</span>nb 4<span>]</span></a></sup></p>

<p>Green ran into problems with Go Man Go's registration. At that time, the AQHA had two types of registration, the Appendix and the Tentative. Appendix-registered horses were the offspring of Thoroughbreds and either Tentative-registered Quarter Horses or Appendix-registered Quarter Horses. Go Man Go was originally registered in the Appendix, as his dam was an Appendix-registered mare. The way to advance out of the Appendix into the Tentative registry was to qualify on performance grounds and pass a <a href="/wiki/Equine_conformation" title="Equine conformation">conformation</a> examination conducted by the AQHA. Go Man Go certainly qualified under the performance criteria, but his conformation was such that he resembled a Thoroughbred more than he resembled a Quarter Horse. Green knew that in order to increase his <a href="/wiki/Stud_fee" title="Stud fee">stud fees</a>—the price paid for the right to breed a mare to a stallion—Go Man Go needed to acquire a regular registration number instead of his Appendix number. So Green appealed to the Executive Committee of the AQHA, which had the authority to award Tentative numbers to horses regardless of conformation exam results. In both 1956 and 1957, the committee declined to take action, waiting to evaluate the quality of Go Man Go's first <a href="/wiki/Foal" title="Foal">foals</a> before making a decision. Finally, in 1958, they awarded Go Man Go number 82,000 in the Tentative registry.<sup id="cite_ref-Legends_7-4" class="reference"><a href="#cite_note-Legends-7" title=""><span>[</span>8<span>]</span></a></sup></p>
<p><a name="Breeding_career_and_legacy" id="Breeding_career_and_legacy"></a></p>
<h2><span class="editsection">[<a href="/w/index.php?title=Go_Man_Go&amp;action=edit&amp;section=4" title="Edit section: Breeding career and legacy">edit</a>]</span> <span class="mw-headline">Breeding career and legacy</span></h2>

<p>Retired to the breeding shed, he early on proved his worth as a <a href="/wiki/Stallion_(horse)" title="Stallion (horse)" class="mw-redirect">stallion</a>.<sup id="cite_ref-Legends_7-5" class="reference"><a href="#cite_note-Legends-7" title=""><span>[</span>8<span>]</span></a></sup> Of his first foal crop, born in 1958, three reached the finals of the <a href="/wiki/All_American_Futurity" title="All American Futurity">All American Futurity</a>: Mr Meyers, Dynago Miss and Angie Miss.<sup id="cite_ref-Wiggins110_28-0" class="reference"><a href="#cite_note-Wiggins110-28" title=""><span>[</span>25<span>]</span></a></sup><sup id="cite_ref-30" class="reference"><a href="#cite_note-30" title=""><span>[</span>nb 5<span>]</span></a></sup> His stud fee in 1960 was $500 ($3,500 in 2007 dollars), but by 1963 it had risen to $2,500 ($16,928 in 2007 dollars).<sup id="cite_ref-Complete443_31-0" class="reference"><a href="#cite_note-Complete443-31" title=""><span>[</span>27<span>]</span></a></sup><sup id="cite_ref-32" class="reference"><a href="#cite_note-32" title=""><span>[</span>28<span>]</span></a></sup> He sired 942&#160;foals, of which 552 earned their Race Register of Merit. Seventy-two of his offspring were awarded a Superior Race Horse award.<sup id="cite_ref-Legends_7-6" class="reference"><a href="#cite_note-Legends-7" title=""><span>[</span>8<span>]</span></a></sup> Among his <a href="/wiki/Get_(animal)" title="Get (animal)">get</a>, or offspring, were Go Josie Go, Dynago Miss, Duplicate Copy, Story Man, and Hustling Man.<sup id="cite_ref-Pitzer_5-2" class="reference"><a href="#cite_note-Pitzer-5" title=""><span>[</span>6<span>]</span></a></sup> His daughter <a href="/wiki/Goetta" title="Goetta">Goetta</a> won the <a href="/wiki/All_American_Futurity" title="All American Futurity">All American Futurity</a> and was inducted into the <a href="/wiki/American_Quarter_Horse_Hall_of_Fame" title="American Quarter Horse Hall of Fame">American Quarter Horse Hall of Fame</a>.<sup id="cite_ref-Hall07_33-0" class="reference"><a href="#cite_note-Hall07-33" title=""><span>[</span>29<span>]</span></a></sup> Another daughter, <a href="/wiki/Ought_To_Go" title="Ought To Go">Ought To Go</a> was also inducted into the AQHA Hall of Fame.<sup id="cite_ref-AQHAHoF_1-1" class="reference"><a href="#cite_note-AQHAHoF-1" title=""><span>[</span>2<span>]</span></a></sup> Eight of his offspring won Champion Quarter Running Horse awards.<sup id="cite_ref-Pitzer_5-3" class="reference"><a href="#cite_note-Pitzer-5" title=""><span>[</span>6<span>]</span></a></sup> His entry listing his offspring who won Race Register of Merits in the <i>Quarter Racing Digest</i> covers five full pages plus part of another.<sup id="cite_ref-Digest_2-6" class="reference"><a href="#cite_note-Digest-2" title=""><span>[</span>3<span>]</span></a></sup> As a broodmare sire, or maternal grandsire, his daughters have produced Rocket Wrangler, Mr Kid Charge, <a href="/wiki/Kaweah_Bar" title="Kaweah Bar">Kaweah Bar</a>, and Go Together.<sup id="cite_ref-Wiggins110_28-1" class="reference"><a href="#cite_note-Wiggins110-28" title=""><span>[</span>25<span>]</span></a></sup><sup id="cite_ref-Denhardt268_34-0" class="reference"><a href="#cite_note-Denhardt268-34" title=""><span>[</span>30<span>]</span></a></sup><sup id="cite_ref-Wiggins91_35-0" class="reference"><a href="#cite_note-Wiggins91-35" title=""><span>[</span>31<span>]</span></a></sup> As of April 2008, his offspring had earned over $7,000,000 on the racetrack.<sup id="cite_ref-SireRecord_6-2" class="reference"><a href="#cite_note-SireRecord-6" title=""><span>[</span>7<span>]</span></a></sup></p>

<p>Even though he was foaled in 1953, and most of his offspring raced before the days of large purses, as of April 2008, he was still number&#160;22 on the AQHA's All-Time Leading Sires of Winners list, and ranked 41 on the same listed organized by race earnings.<sup id="cite_ref-SireWins_36-0" class="reference"><a href="#cite_note-SireWins-36" title=""><span>[</span>32<span>]</span></a></sup> As a broodmare sire, he still is number&#160;two on the AQHA's list of All-Time Leading Broodmare sires of winners, and number&#160;ten on the same list arranged by earnings.<sup id="cite_ref-SireWins_36-1" class="reference"><a href="#cite_note-SireWins-36" title=""><span>[</span>32<span>]</span></a></sup></p>
<p>As a breeding stallion, Go Man Go continued to have a reputation as a scoundrel, although Kathlyn Green, wife of A. B. Green, disputed that image. She said that he liked to have his lip tugged, and would lean over the stall door waiting for people to come along and tug on it for him.<sup id="cite_ref-Legends_7-7" class="reference"><a href="#cite_note-Legends-7" title=""><span>[</span>8<span>]</span></a></sup> However, she said of him "he absolutely hated getting his feet dirty".<sup id="cite_ref-QLegends124_37-0" class="reference"><a href="#cite_note-QLegends124-37" title=""><span>[</span>33<span>]</span></a></sup> Go Man Go passed through a number of hands after Green owned him, including Les Gosselin, Frank Vessels, and Harriett Peckham, who was his owner by 1972.<sup id="cite_ref-Legends_7-8" class="reference"><a href="#cite_note-Legends-7" title=""><span>[</span>8<span>]</span></a></sup> He died in 1983 and was buried near the headquarters of the Buena Suerte Ranch in <a href="/wiki/Roswell,_New_Mexico" title="Roswell, New Mexico">Roswell, New Mexico</a>. His crown-shaped granite headstone is engraved: "Go Man Go, The King."<sup id="cite_ref-LastRites_38-0" class="reference"><a href="#cite_note-LastRites-38" title=""><span>[</span>34<span>]</span></a></sup></p>

<p>He was inducted into the American Quarter Horse Hall of Fame in 1990.<sup id="cite_ref-AQHAHoF_1-2" class="reference"><a href="#cite_note-AQHAHoF-1" title=""><span>[</span>2<span>]</span></a></sup> A further honor was the naming of a stakes race after him,<sup id="cite_ref-Complete311_39-0" class="reference"><a href="#cite_note-Complete311-39" title=""><span>[</span>35<span>]</span></a></sup> the <a href="/wiki/Graded_stakes_race" title="Graded stakes race">Grade I</a> Go Man Go Handicap run in September at Los Alamitos.<sup id="cite_ref-StakesSchedule_40-0" class="reference"><a href="#cite_note-StakesSchedule-40" title=""><span>[</span>36<span>]</span></a></sup> Walt Wiggins, a racing commentator and author, said of Go Man Go: "He was a brilliant speedhorse, some say the fastest ever. He was wild and reckless, a rogue at first, and often a clown who seldom saw the uniqueness of his talents or the seriousness of his commission. He had intrinsic greatness and couldn't care less."<sup id="cite_ref-Wiggins78_41-0" class="reference"><a href="#cite_note-Wiggins78-41" title=""><span>[</span>37<span>]</span></a></sup> Dan Essary, who was Director of Racing for the AQHA for many years, described Go Man Go's impact on the Quarter Horse breed as "He was to Quarter Horse racing what Babe Ruth was to baseball, what Ben Hogan was to Golf and what Man o'War was to Thoroughbred racing. Horses may have run faster and horses have earned more money, but the fame of Go Man Go lingers."<sup id="cite_ref-QWiggins112_42-0" class="reference"><a href="#cite_note-QWiggins112-42" title=""><span>[</span>38<span>]</span></a></sup></p>

