<h2><span class="editsection">[<a href="/w/index.php?title=Go_Man_Go&amp;action=edit&amp;section=6" title="Edit section: Notes">edit</a>]</span> <span class="mw-headline">Notes</span></h2>

<div class="references-2column">
<ol class="references">
<li id="cite_note-12"><b><a href="#cite_ref-12" title="">^</a></b> Other sources give a sale price of $300 for Lightfoot Sis.<sup id="cite_ref-11" class="reference"><a href="#cite_note-11" title=""><span>[</span>12<span>]</span></a></sup></li>
<li id="cite_note-13"><b><a href="#cite_ref-13" title="">^</a></b> A horse's pregnancy lasts 11 months and two weeks.</li>
<li id="cite_note-16"><b><a href="#cite_ref-16" title="">^</a></b> Quarter Horses are closely related to Thoroughbreds, and many Quarter Horse race horses are descended mostly from Thoroughbred bloodlines. The <a href="/wiki/American_Quarter_Horse_Association" title="American Quarter Horse Association">AQHA</a> allows the registration of the offspring of a Thoroughbred and a Quarter Horse, but they are registered into a special section of the AQHA's <a href="/wiki/Stud_book" title="Stud book" class="mw-redirect">stud book</a>, the Appendix Section. In order to qualify for full registration in the main section of the stud book, the horse must prove itself in competition, either racing or in the <a href="/wiki/Horse_show" title="Horse show">show ring</a>. Once it does so, the horse is considered a full-blooded Quarter Horse. It is possible, and often happens, that an Appendix-registered horse will qualify for a regular registration number, then be bred back to a Thoroughbred, starting the cycle once more. This explains how horses such as <a href="/wiki/Easy_Jet" title="Easy Jet">Easy Jet</a> or Go Man Go can have many more Thoroughbred ancestors than Quarter Horses but still be considered Quarter Horses.<sup id="cite_ref-15" class="reference"><a href="#cite_note-15" title=""><span>[</span>14<span>]</span></a></sup></li>

<li id="cite_note-27"><b><a href="#cite_ref-27" title="">^</a></b> Top Deck died of an illness in 1965, after heroic efforts by vets to save his life. The cause of death of Go Man Go's mother and siblings is not given in the sources.<sup id="cite_ref-26" class="reference"><a href="#cite_note-26" title=""><span>[</span>24<span>]</span></a></sup></li>
<li id="cite_note-30"><b><a href="#cite_ref-30" title="">^</a></b> They finished fifth, sixth and eighth, respectively.<sup id="cite_ref-29" class="reference"><a href="#cite_note-29" title=""><span>[</span>26<span>]</span></a></sup></li>
<li id="cite_note-43"><b><a href="#cite_ref-43" title="">^</a></b> (TB) is an abbreviation for Thoroughbred.</li>

<li id="cite_note-44"><b><a href="#cite_ref-44" title="">^</a></b> An asterisk means the horse was imported into North America.</li>
</ol>
